import React,{ useState} from "react"; 
import { Container, Grid ,CardMedia, Typography,TextField, Button,Select,FormControl,MenuItem,
Table,TableBody,TableCell,TableHead,TableRow} from "@material-ui/core";
import { DataGrid } from '@material-ui/data-grid';
import logoicon from '../logoicon.jpeg';
import IconButton from "@material-ui/core/IconButton";
// Icons
import EditIcon from "@material-ui/icons/EditOutlined";
import DoneIcon from "@material-ui/icons/DoneAllTwoTone";
import RevertIcon from "@material-ui/icons/NotInterestedOutlined";
import Input from "@material-ui/core/Input";

const columns = [
    { field: 'order', headerName: 'NÂº', width: 100, editable: true },
    { field: 'line', headerName: 'Linea', width: 160, editable: true },
    {
      field: 'model',
      headerName: 'Modelo', 
      width: 180,
      editable: true,
    },
    {
      field: 'middle',
      headerName: 'Medio', 
      width: 220,
      editable: true,
    },    
    {
        field: 'service',
        headerName: 'Servicio', 
        width: 220,
        editable: true,
      },
      {
        field: 'place',
        headerName: 'Lugar', 
        width: 220,
        editable: true,
      },
  ];




const Demand = () =>{

    const [ demandModel , setDemandModel ] = useState({
        RequestId : 0,
        Applicationseries : '',
        ClientID : '',
        Contact : '',
        Correlative : '',
        CustomerAddress : '',
        Dateofissue : '',
        IdCategory : '',
        IdPriority : '',
        Phone : '',
        Reason: '',
        Responsible: '',
        ScheduledDate: '',
        Adviser :''
    });

    const [ clientModel , setClientModel ] = useState({
        ClientID : 0,
        CustomerName : '',
        CustomerAddress: '',
        RUCClient : ''
    });


    const createData = (name, calories, fat, carbs, protein) => ({
        id: name.replace(" ", "_"),
        name,
        calories,
        fat,
        carbs,
        protein,
        isEditMode: false
      });


    const [previous, setPrevious] = useState({});
    const [rows, setRows] = useState([
        createData("Frozen yoghurt", 159, 6.0, 24, 4.0),
        createData("Ice cream sandwich", 237, 9.0, 37, 4.3),
        createData("Eclair", 262, 16.0, 24, 6.0)

    ]);
    const onToggleEditMode = id => {
        setRows(state => {
          return rows.map(row => {
            if (row.id === id) {
              return { ...row, isEditMode: !row.isEditMode };
            }
            return row;
          });
        });
      };

      const onChange = (e, row) => {
        if (!previous[row.id]) {
          setPrevious(state => ({ ...state, [row.id]: row }));
        }
        const value = e.target.value;
        const name = e.target.name;
        const { id } = row;
        const newRows = rows.map(row => {
          if (row.id === id) {
            return { ...row, [name]: value };
          }
          return row;
        });
        setRows(newRows);
      };

      const onRevert = id => {
        const newRows = rows.map(row => {
          if (row.id === id) {
            return previous[id] ? previous[id] : row;
          }
          return row;
        });
        setRows(newRows);
        setPrevious(state => {
          delete state[id];
          return state;
        });
        onToggleEditMode(id);
      };


      const CustomTableCell = ({ row, name, onChange }) => {

        const { isEditMode } = row;
        return (
          <React.Fragment>

          <TableCell align="left" >
            {isEditMode ? (
              <Input
                value={row[name]}
                name={name}
                onChange={e => onChange(e, row)}
              />
            ) : (
              row[name]
            )}
          </TableCell>
          </React.Fragment>
        );
      };


    return(
        <Container fullwidth style={{marginTop:50}} >
            <Grid container spacing={2}>
                <Grid item  md={3} xs={12} >
                <CardMedia
                    style={{height: 200, width: 200}}
                    component="img"
                    alt="Biossay"
                    height="auto"
                    image={logoicon}
                />
                </Grid>
                <Grid item  md={5} xs={12}>
                    <Typography variant="h4" style={{ fontWeight:"bold" ,height:"30%"}}>BIOSSAY PERU</Typography>
                    <Typography style={{ height:"30%"}}>OFICINA PRINCIPAL - CALLE LAS CERECITAS MZ. L III LOTE 45 URB. INCA MANCO CAPAC SAN JUAN DE LURIGANCHO - LIMA - LIMA</Typography>
                    <Typography style={{ height:"10%"}}>TELEFONO: (01) 458-6631</Typography>
                    <Typography style={{ height:"10%"}}>CEL: 991463701 / 980658053</Typography>
                    <Typography style={{ height:"10%"}}>EMAIL : gerencia@biossay.com.pe</Typography>
                </Grid>
                <Grid item  md={4} xs={12} style= {{ borderStyle : "solid",textAlign:"center"}} >
                    <Typography  variant="h5"  style={{ height:"33%"}}>RUC 20563090805</Typography>
                    <Typography  variant="h5"  style={{ height:"33%" ,fontWeight:"bold" }}>SOLICITUD DE SERVICIO</Typography>
                    <Typography  variant="h5"  style={{ height:"33%"}}>0001-2821</Typography>
                </Grid>

                <Grid container md={6} direction="row" style={{marginTop:20}} alignItems="center">
                    <Grid item md={3}> 
                        <Typography> RUC </Typography> 
                    </Grid>
                    <Grid item md={8} direction="row">  
                        <TextField fullWidth id="outlined-basic" label="" variant="outlined" value={clientModel.RUCClient} name="RUCClient" />
                    </Grid>
                </Grid>
                <Grid container md={6} direction="row"style={{marginTop:20}}  alignItems="center">
                    <Grid item md={3}> 
                        <Typography> F. EmisiÃ³n </Typography> 
                    </Grid>
                    <Grid item md={9} direction="row">  
                        <TextField type="date" fullWidth id="outlined-basic" label="" variant="outlined" value={demandModel.Dateofissue} name="Dateofissue" />
                    </Grid>
                </Grid>
                <Grid container md={6} direction="row" style={{marginTop:20}} alignItems="center">
                    <Grid item md={3}> 
                        <Typography> Cliente </Typography> 
                    </Grid>
                    <Grid item md={8} direction="row">  
                        <TextField fullWidth id="outlined-basic" label="" variant="outlined" value={clientModel.CustomerName} name="CustomerName"  />
                    </Grid>
                </Grid>
                <Grid container md={6} direction="row" style={{marginTop:20}}  alignItems="center">
                    <Grid item md={3}> 
                        <Typography> Prioridad</Typography> 
                    </Grid>
                    <Grid item md={9} direction="row">  
                    <FormControl fullWidth variant="outlined"  > 
                        <Select
                        labelId="demo-simple-select-outlined-label"
                        id="demo-simple-select-outlined"
                        value={demandModel.IdPriority} 
                        fullWidth
                        label="Age"
                        name="IdPriority"
                        >
                        <MenuItem value="">
                            <em>None</em>
                        </MenuItem>
                        <MenuItem value={10}><input type="color" value="#FF0000" disabled /></MenuItem>
                        <MenuItem value={20}><input type="color" value="#1DEE2D" disabled /></MenuItem>
                        <MenuItem value={30}><input type="color" value="#EEEA0D" disabled /></MenuItem>
                        <MenuItem value={30}><input type="color" value="#DDDDD8" disabled /></MenuItem>
                        <MenuItem value={30}><input type="color" value="#3F80CA" disabled /></MenuItem>
                        </Select>

                    </FormControl>
                    </Grid>
                </Grid>
                <Grid container md={6} direction="row"  style={{marginTop:20}} alignItems="center">
                    <Grid item md={3}> 
                        <Typography> DirecciÃ³n </Typography> 
                    </Grid>
                    <Grid item md={8} direction="row">  
                        <TextField fullWidth id="outlined-basic" label="" variant="outlined" name="CustomerAddress" value={clientModel.CustomerAddress} />
                    </Grid>
                </Grid>
                <Grid container md={6} direction="row" style={{marginTop:20}} alignItems="center">
                    <Grid item md={3}> 
                        <Typography> Responsable </Typography> 
                    </Grid>
                    <Grid item md={9} direction="row">  
                        <TextField fullWidth id="outlined-basic" name="Responsible" value={demandModel.Responsible} label="" variant="outlined" />
                    </Grid>
                </Grid>
                <Grid container md={6} direction="row" style={{marginTop:20}} alignItems="center">
                    <Grid item md={3}> 
                        <Typography> CategorÃ­a </Typography> 
                    </Grid>
                    <Grid item md={8} direction="row">  
                    <FormControl fullWidth variant="outlined"  > 
                        <Select
                        labelId="demo-simple-select-outlined-label"
                        id="demo-simple-select-outlined" 
                        fullWidth
                        label="Age"
                        name="IdCategory"
                        value={demandModel.IdCategory}
                        >
                        <MenuItem value="">
                            <em>Seleccione</em>
                        </MenuItem>
                        <MenuItem value={10}>SIN CATEGORIA</MenuItem>
                        <MenuItem value={20}>BRONZE</MenuItem>
                        <MenuItem value={30}>SILVER</MenuItem>
                        <MenuItem value={30}>GOLD</MenuItem>
                        <MenuItem value={30}>PLATINUM</MenuItem>
                        <MenuItem value={30}>DIAMOND</MenuItem>
                        </Select>

                    </FormControl>
                    </Grid>
                </Grid>
                <Grid container md={6} direction="row" style={{marginTop:20}} alignItems="center">
                    <Grid item md={3}> 
                        <Typography> F. Programada </Typography> 
                    </Grid>
                    <Grid item md={9}  direction="row">  
                        <TextField type="date" fullWidth id="outlined-basic" label="" variant="outlined" name="ScheduledDate" value={demandModel.ScheduledDate} />
                    </Grid>
                </Grid> 

                <div style={{ height: 400, width: '100%',marginTop:20 }}>
                    <Button onClick={addEntryClick} > Agregar Item</Button>
                    <Table  aria-label="caption table">
        <caption>A barbone structure table example with a caption</caption>
        <TableHead>
          <TableRow>
            <TableCell align="left" />
            <TableCell align="left">Dessert (100g serving)</TableCell>
            <TableCell align="left">Calories</TableCell>
            <TableCell align="left">Fat&nbsp;(g)</TableCell>
            <TableCell align="left">Carbs&nbsp;(g)</TableCell>
            <TableCell align="left">Protein&nbsp;(g)</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map(row => (
            <TableRow key={row.id}>
              <TableCell >
                {row.isEditMode ? (
                  <>
                    <IconButton
                      aria-label="done"
                      onClick={() => onToggleEditMode(row.id)}
                    >
                      <DoneIcon />
                    </IconButton>
                    <IconButton
                      aria-label="revert"
                      onClick={() => onRevert(row.id)}
                    >
                      <RevertIcon />
                    </IconButton>
                  </>
                ) : (
                  <IconButton
                    aria-label="delete"
                    onClick={() => onToggleEditMode(row.id)}
                  >
                    <EditIcon />
                  </IconButton>
                )}
              </TableCell>
              <CustomTableCell {...{ row, name: "name", onChange }} />
              <CustomTableCell {...{ row, name: "calories", onChange }} />
              <CustomTableCell {...{ row, name: "fat", onChange }} />
              <CustomTableCell {...{ row, name: "carbs", onChange }} />
              <CustomTableCell {...{ row, name: "protein", onChange }} />
            </TableRow>
          ))}
        </TableBody>
      </Table>
                </div>
                <Grid container md={12} direction="row" style={{marginTop:20}} alignItems="center">
                    <Grid item md={3}> 
                        <Typography> Asesor Comercial </Typography> 
                    </Grid>
                    <Grid item md={8} direction="row">  
                        <TextField fullWidth id="outlined-basic" label="" variant="outlined" name="Adviser" value={demandModel.Adviser} />
                    </Grid>
                </Grid>
                <Grid container md={12} direction="row" style={{marginTop:20}} alignItems="center">
                    <Grid item md={3}> 
                        <Typography> Motivo </Typography> 
                    </Grid>
                    <Grid item md={8} direction="row">  
                        <TextField fullWidth id="outlined-basic" label="" variant="outlined" name="Reason" value={demandModel.Reason} />
                    </Grid>
                </Grid>
                <Grid container md={12} direction="row" style={{marginTop:20}} alignItems="center">
                    <Grid item md={3}> 
                        <Typography> Contacto </Typography> 
                    </Grid>
                    <Grid item md={8} direction="row">  
                        <TextField fullWidth id="outlined-basic" label="" variant="outlined" name="Contact" value={demandModel.Contact} />
                    </Grid>
                </Grid>
                <Grid container md={12} direction="row" style={{marginTop:20,marginBottom:30}} alignItems="center">
                    <Grid item md={3}> 
